import { MDBContainer, MDBRow, MDBCol,MDBCard, MDBCardBody,MDBCarousel, MDBCarouselInner, MDBCarouselItem, MDBView } from "mdbreact";


import axios from 'axios'

export default class dashboard extends Component {
  constructor(props){
    super(props)
  }
  logout = async() => {
  const token = localStorage.getItem('token')
  const header = { header: { header } };
  const res = await axios.post('http://localhost:5000/users/me/logout',header)
}
  render(){
    return(
      <div className="bg">
        {this.props.infouser}
        <MDBContainer >
          <center>
            <MDBRow > 
              <MDBCol size="8" className="cont">
              </MDBCol>
